import React from "react";
import "../styles/Instagram.css";
import InstagramLogo from "../images/instagram.png";

const Instagram = () => {
  return (
    <div className="instagram-section">
      <div className="instagram-section-phrase">
        <p>Compartí la experiencia usando el hashtag</p>
      </div>
      <div className="instagram-section-image">
        <img src={InstagramLogo} />
      </div>
      <div className="instagram-section-hashtag">
        <p>#luytano</p>
      </div>
      <button type="button">
        <a
          target="_blank"
          rel="noreferrer"
          href="https://goo.gl/maps/kAbPHbbyrnAPdWED7"
        >
          Ver en Instagram
        </a>
      </button>
      <h1 className="greetings-phrase">¡Te esperamos!</h1>
    </div>
  );
};

export default Instagram;
